import React from "react";
import styles from "./CoordinatorDashboard.module.css";

const RightSidebar = () => {
  const recentContacts = [
    "Samantha William",
    "Tony Soap",
    "Karen Hope",
    "Jordan Nico",
    "Nadila Adja",
  ];

  const messages = [
    { name: "Samantha William", time: "12:45 PM", message: "Lorem ipsum dolor sit amet." },
    { name: "Tony Soap", time: "12:45 PM", message: "Lorem ipsum dolor sit amet." },
    { name: "Jordan Nico", time: "12:45 PM", message: "Lorem ipsum dolor sit amet." },
    { name: "Nadila Adja", time: "12:45 PM", message: "Lorem ipsum dolor sit amet." },
  ];

  const fairs = ["Lorem ipsum dolor sit amet.", "Lorem ipsum dolor sit amet.", "Lorem ipsum dolor sit amet."];

  return (
    <div className={styles.rightSidebar}>
      {/* User Info */}
      <div className={styles.userInfo}>
        <h3 className={styles.userName}>Nabila A.</h3>
        <p className={styles.userRole}>Coordinator</p>
      </div>

      {/* Recent Contacts */}
      <div className={styles.recentContacts}>
        <h4>Recent Contacts</h4>
        <ul>
          {recentContacts.map((contact, index) => (
            <li key={index} className={styles.contactItem}>
              <span className={styles.contactDot} />
              {contact}
            </li>
          ))}
        </ul>
        <button className={styles.viewAllButton}>View All</button>
      </div>

      {/* Messages */}
      <div className={styles.messages}>
        <h4>Messages</h4>
        <ul>
          {messages.map((msg, index) => (
            <li key={index} className={styles.messageItem}>
              <div className={styles.messageName}>
                <strong>{msg.name}</strong>
                <span className={styles.messageTime}>{msg.time}</span>
              </div>
              <p className={styles.messageContent}>{msg.message}</p>
            </li>
          ))}
        </ul>
        <button className={styles.viewAllButton}>View All</button>
      </div>

      {/* Upcoming Fairs */}
      <div className={styles.upcomingFairs}>
        <h4>Upcoming Fairs</h4>
        <ul>
          {fairs.map((fair, index) => (
            <li key={index} className={styles.fairItem}>
              {fair}
            </li>
          ))}
        </ul>
        <button className={styles.viewAllButton}>View All</button>
      </div>
    </div>
  );
};

export default RightSidebar;
